import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import Particles from "react-particles-js"
import Navbar from "./componentes/navbar";
import Header from "./componentes/header";

function App() {
  return (
    <>
    <Particles
      params={{
        particles: {
          number: {
            value: 90,
            density: {
              enable: true,
              value_area: 700
            }
          },
          shape: {
            type: "circle",
            stroke: {
              width: 6,
              color: "#f9ab00"
            }
          }
        }
      }}
    />
    <Navbar />
    <Header /> 
    </>
  );
}

export default App;
